import React from "react";
import FirstSection from "./FirstSection";
import SecondSection from "./SecondSection";
import ThirdSection from "./ThirdSection";
import Footer from "../Footer/Footer";

const Amenagement = () => {
  return (
    <>
    <FirstSection />
    <SecondSection />
    <ThirdSection />
    <Footer />
    </>
  );
};

export default Amenagement;
